Compiler (or somewhere in that region).  This also seems to be the
problem indicated in your previous post.  They aren&#39;t real compilation
errors.  They are artificial errors to help you code better (don&#39;t allow
unneeded imports, unused variables/methods, etc.).  They are all
configurable, just turn them off if you don&#39;t like them (set the option
to &#39;ignore&#39;).

